import React from "react";
import { Route } from "react-router-dom";

function Ad({ ad }) {
  return (
    <div>
      <h2>{ad.name}</h2>
      <p>{ad.description}</p>
      <Link to={`/ads/${ad.id}`}>
        <img src={ad.image} alt="product/service" />
      </Link>
      <h3>${ad.price}</h3>
    </div>
  );
}

export default Ad;
